import {
    appbarHeight
} from '../../masterStyle.js';

const goldenRatio = 1.61803398875;

const dashboardStyle = theme => ({
    container: {
        height: "100%",
        marginTop: "2rem",
        [theme.breakpoints.up('sm')]: {
            marginLeft: theme.spacing(5),
            marginRight: theme.spacing(5),
            width: "inherit"
        }
    },
    title: {
        padding: "1.5rem"
    },
});

export default dashboardStyle;
